HQ rare promo music video. &quot;Sweet Talkin' Woman&quot; is a 1978 single by The Electric Light Orchestra from the LP Out of the Blue. Its original title was &quot;Dead End Street,&quot; but changed during recording, perhaps to avoid confusion with a 1966 hit of the same title by the Kinks. Some words that survived from that version can be heard in the opening of the third verse, I've been livin' on a dead end street.Ãƒâ€šÃ‚ï¿½

The track became the third Top Ten hit from the LP in the UK, peaking at No. 6. As a novelty, initial copies of the 12&quot; and 7&quot; formats were pressed in transparent purple vinyl.

The version released in the United States was 10 seconds shorter than its British counterpart due to a slightly faster mix. In the U.S., it reached #17 on the Billboard chart in the spring of 1978.
